  false,\n\t\"url\": null,\n\t\"notes\": \"Oregon silverspot butterfly (OSB) has been
  listed as threatened under the ESA since October 15, 1980. The Oregon silverspot
  butterfly is now considered to be extirpated from Washington State and northwestern
  Oregon. Habitat creation and enhancement are essential tasks delineated in the Oregon
  silverspot butterfly Recovery Plan and are an important aspect of cooperative conservation
  efforts between agencies and partners managing coastal prairie habitat. Recent efforts
  to restore native coastal prairie to the Refuge is aimed at providing suitable habitat
  for a reintroduction of the OSB and to provide habitat for other native pollinators.Little
  is known about effective coastal prairie restoration in this region; thus we are
  testing multiple site preparation and management techniques in replicated plots
  at multiple locations in order to both inform future restoration and to improve
  our chances of success. After five years, an adaptive management plan will be developed
  and effective site preparation/treatment would be available for use at other restoration
  sites. Our goal is to create habitat suitable for the reintroduction of the OSB
  by introducing a combination of site preparation and treatment methods that will
  replicate the historical natural disturbance regime of blowing sand. Long-term maintenance
  of restored coastal prairie habitat will be dependent on achieving this goal. Information
  gathered during this project will meet both the short-term conservation needs for
  the OSB and the long-term conservation needs for species dependent on coastal prairie
  dune habitat.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
